import { Switch, Route } from "react-router-dom";
import routes from "./routesConfig";

export default function Routes() {
  const { isLoading } = useAuth0();
  return (
    <Switch>
      {routes.map(({ ...page }) => {
        return <Route {...page} />;
      })}
    </Switch>
  );
}
